const Layout = ({name}: LayoutType) => {

  let menu;

  if(name===''){
    menu = (
      <div>niezalogowany</div>
    )
  }
  else {
    menu = (
      <div>zalogowany</div>
    )
  }

  return (
    <>
      <nav>
        <ul>
          <li>
            <Link to="/">HomePage</Link>
          </li>
          <li>
            <Link to="/login">Login Page</Link>
          </li>
          <li>
            <Link to="/register">Register Page</Link>
          </li>
        </ul>
      </nav>
      <div>
        {name} 
      </div>
      <Outlet />
    </>
  )
};

export default Layout;
